-- ----------------------------
-- Table structure for transactions
-- ----------------------------
DROP TABLE IF EXISTS `transactions`;
CREATE TABLE `transactions` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL DEFAULT '0' COMMENT 'user_id in users',
  `provider_type` tinyint(1) NOT NULL DEFAULT '0' COMMENT 'id in _provider_types',
  `provider_id` int(11) NOT NULL DEFAULT '0' COMMENT 'id in depend on provider_type',
  `amount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT 'amount',
  `alias` tinyint(3) NOT NULL DEFAULT '0' COMMENT 'id in _transaction_alias',
  `status` tinyint(2) NOT NULL DEFAULT '0' COMMENT '0 - თანხის შემოტანა; 1 - გატანის მოთხოვნა;2 - სლოტებში გადატანა;3 - სლოტებიდან გადმოტანა 4 - ბილეთებში დადება (bet);5 - ბილეთებში მოგება (win);6 - ბილეთებში ვაზვრატი (void);7 - უარყოფა გატანაზე;  8 - rollback;9 - bet_error;  10- კორექცია;11 - კაზინოზე გადატანა; 12- კაზინოდან გადმოტანა;13- ტ10 გადატანა;14- ტ10 გადმოტანა;15- ძველი თანხის დასმა;16-ბილეთებში ბონუსი',
  `visible_` tinyint(1) NOT NULL DEFAULT '1' COMMENT '0-hide; 1-visible',
  `insert_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `provider_id` (`provider_id`)
) ENGINE=InnoDB AUTO_INCREMENT=26863 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

